import {NativeBaseProvider, StatusBar} from "native-base";
import { NavigationContainer } from "@react-navigation/native";

export default function App() {
  return (
    <NativeBaseProvider>
      <NavigationContainer>
        <StatusBar></StatusBar>
      </NavigationContainer>
    </NativeBaseProvider>
  );
}

